import { Container, Toolbar, AppBar, Typography, CssBaseline } from "@material-ui/core";
import Login from "../components/Login";
import Pomodoro from "../assets/pomodoro.png";

const Home = () => {
  return (
    <div>
      <CssBaseline/>
    <AppBar position="relative">
      <Toolbar>
        <img src={Pomodoro} width="5000"/>
        <Typography variant="h6">
          Tomato Pomodoro
        </Typography>
      </Toolbar>
    </AppBar>
    {/* <Login/> */}
    </div>
  );
}

export default Home;
